### Summary of Core Topics, Concepts, Principles, and Equations

#### Database Management Systems

1. **Normalization and Functional Dependencies**
   - **Normal Forms**: 1NF, 2NF, 3NF, BCNF, 4NF
   - **Functional Dependencies (FD)**: Defined as \( X \rightarrow Y \), where \( X \) and \( Y \) are sets of attributes.
   - **Multi-Valued Dependencies (MVD)**: Defined as \( X \rightarrow\rightarrow Y \).
   - **Normalization Process**: Decomposing relations to eliminate redundancies and anomalies.
   - **BCNF**: A relation is in BCNF if for every non-trivial FD \( X \rightarrow Y \), \( X \) is a superkey.
   - **4NF**: A relation is in 4NF if it is in BCNF and has no non-trivial MVDs.

2. **Decomposition**
   - **Dependency Preservation**: Ensuring that the decomposition of a relation preserves all functional dependencies.
   - **Lossless Join Decomposition**: Ensuring that the decomposition of a relation can be joined back to form the original relation without loss of information.

3. **Database Connectivity**
   - **PostgreSQL Connection**: Using `psycopg2` library in Python to connect to a PostgreSQL database.
     ```python
     connection = psycopg2.connect(database=dbname, user=username, password=pwd, host=address, port=portnum)
     ```

4. **Superkeys and Candidate Keys**
   - **Superkey**: A set of attributes that uniquely identifies a tuple in a relation.
   - **Candidate Key**: A minimal superkey, meaning no proper subset of the superkey is a superkey itself.

5. **Disk Storage and Access Time**
   - **Storage Capacity**: Calculated as:
     \[
     \text{Total Capacity} = \text{Number of Platters} \times \text{Surfaces per Platter} \times \text{Tracks per Surface} \times \text{Sectors per Track} \times \text{Bytes per Sector}
     \]
   - **Disk Access Time**: Calculated as:
     \[
     \text{Disk Access Time} = \text{Seek Time} + \text{Rotational Latency}
     \]
     where Rotational Latency is given by:
     \[
     \text{Rotational Latency} = \frac{1}{2} \times \frac{60}{\text{RPM}} \times 1000 \text{ ms}
     \]

#### Data Structures

1. **Binary Search Tree (BST)**
   - **Insertion**: Process of adding nodes to the BST while maintaining the BST property.
   - **Height of BST**: The length of the longest path from the root to a leaf node.
   - **Leaf Nodes**: Nodes with no children.
   - **Level of a Node**: The number of edges on the path from the root to the node.

